const theme = {
  primary: "#ffc600",
  linkComments: [
    {
      id: 0,
      asLink: "first-comment",
      content: <h2>Hello First comment</h2>,
      href: "/post/[id]/[comment]"
    },
    {
      id: 2,
      asLink: "second-comment",
      content: <h2>Hello Second comment</h2>,
      href: "/post/[id]/[comment]"
    }
  ],
  routers: [
    {
      groupId: 0,
      text: "Routing",
      subRouters: [
        {
          id: 0,
          href: "/post/",
          text: "Dynamic routing"
        },
        {
          id: 1,
          href: "/catch-all-routing/",
          text: ""
        }
      ]
    }
  ]
};

export default theme;
